			padding-right: 0.5rem;
		}

		.sapMSF:not(.sapMSFDisabled):hover .sapMSFF {
			background-color: @sapUiShellHoverBackground;
			box-shadow: @sapUiContentInteractionShadow;
			border-bottom: 1px solid @sapUiFieldHoverBorderColor;
