/* START "CheckBox.less" */
/* ================================== */
/* CSS for control sap.m/CheckBox     */
/* Horizon High Contrast Black theme  */
/* ================================== */

.sapMCb {
	height: 2.75rem;
	padding-left: 2.75rem;
	line-height: 2.75rem;
}

.sapMCb:focus {
	outline: none;
}

.sapMCbBg {
	height: 1.375rem;
	width: 1.375rem;
	top: 0.6875rem;
	left: 0.6875rem;
	box-sizing: border-box;
	border-radius: var(--sapField_BorderCornerRadius);
	background-color: var(--sapField_Background);
	border: var(--sapField_BorderWidth) var(--sapField_BorderColor) solid;
	display: flex;
    align-items: center;
    justify-content: center;
	color: var(--sapContent_Selected_ForegroundColor);

	&.sapMCbMarkChecked::before {
		font-size: 1rem;
		color: currentColor;
	}

	&.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
		border-width: 0.25rem;
	}
}

.sapMCbBgDis {
	opacity: var(--sapContent_DisabledOpacity);
}

.sapMCbRo .sapMCbBg {
	background-color: var(--sapField_ReadOnly_Background);
	border: var(--sapElement_BorderWidth) solid var(--sapField_ReadOnly_BorderColor);
}

.sapMCbRo > .sapMCbBg.sapMCbMarkChecked::before {
	color: var(--sapField_TextColor);
}

.sapMCb:not(.sapMCbErr):not(.sapMCbWarn):not(.sapMCbInfo):not(.sapMCbSucc):hover .sapMCbHoverable {
	border: var(--sapField_BorderWidth) var(--sapField_BorderStyle) var(--sapField_Hover_BorderColor);
	color: var(--sapContent_Selected_ForegroundColor);
	background-color: var(--sapSelectedColor);
}

.sapMCb:hover .sapMCbHoverable {
	background-color: var(--sapField_Hover_Background);
}

/* value state */
.sapMCbErr {

	&:hover .sapMCbBg,
	.sapMCbBg {
		background-color: var(--sapField_InvalidBackground);
	}

	.sapMCbBg {
		border: var(--sapField_InvalidBorderWidth) dashed var(--sapField_InvalidColor);
		color: var(--sapField_InvalidColor);

		&.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
			border-width: 0.1875rem;
		}
	}
}

.sapMCbWarn {

	.sapMCbBg {
		background-color: var(--sapField_WarningBackground);
		border: var(--sapField_WarningBorderWidth) dashed var(--sapField_WarningColor);
		color: var(--sapField_WarningColor);

		&.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
			border-width: 0.1875rem;
		}
	}
}

.sapMCbInfo {

	.sapMCbBg {
		background-color: var(--sapField_InformationBackground);
		border: var(--sapField_InformationBorderWidth) dashed var(--sapField_InformationColor);
		color: var(--sapField_InformationColor);

		&.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
			border-width: 0.25rem;
		}
	}
}

.sapMCbSucc {

	.sapMCbBg {
		background-color: var(--sapField_SuccessBackground);
		border: var(--sapField_SuccessBorderWidth) solid var(--sapField_SuccessColor);
		color: var(--sapField_SuccessColor);
	}
}

.sapMCb.sapMCbDisplayOnly:not(.sapMCbBgDis) {
	padding-left: 2.75rem;
}

.sapMCbDisplayOnly .sapMCbBg {
	top: 0.5625rem;
	left: 0.5625rem;

	&:not(.sapMCbMarkPartiallyChecked).sapMCbMarkChecked::before {
		color: var(--sapTextColor);
		font-size: 1rem;
	}

	&:not(.sapMCbMarkPartiallyChecked)::before {
		color: var(--sapTextColor);
		font-size: 1rem;
	}

	&.sapMCbMark.sapMCbMarkChecked.sapMCbMarkPartiallyChecked {
		width: 0.875rem;
		height: 0.875rem;
		border-radius: 0.0675rem;
		top: 0.9375rem;
		left: 0.9375rem;

		&::before {
			border-width: 0.125rem;
		}
	}
}

/* FOCUS */
.sapMCb {
	outline: none;
}

.sapMCb:focus::before {
	content: '';
	border: var(--sapContent_FocusColor) var(--sapContent_FocusStyle) var(--sapContent_FocusWidth);
	inset: 0.3125rem;
	position: absolute;
	border-radius: var(--sapField_BorderCornerRadius);
}

.sapMCb.sapMCbHasLabel {
	padding-right: 0.3125rem;
}

.sapMCb.sapMCbHasLabel:focus::before {
	content: '';
	border: var(--sapContent_FocusColor) var(--sapContent_FocusStyle) var(--sapContent_FocusWidth);
	top: 0.3125rem;
	left: 0.3125rem;
	bottom: 0.3125rem;
	right: 0;
	position: absolute;
	border-radius: 0.5rem;
}

/* In Form Checkbox needs to be left aligned to bi in line with other controls (as Form itself has a padding) */
.sapUiForm {

	.sapMCbBg {
		left: 0;
	}

	.sapMCb {
		padding-left: 2.0625rem; /* to have right gap between checkbox and label */
	}

	.sapMCb:not(.sapMCbBgDis).sapMCbHasLabel:focus::before,
	.sapMCb:not(.sapMCbBgDis):not(.sapMCbHasLabel):focus::before {
		left: -0.25rem; /* more is not possible as this would cut off the focus border */
	}
}

.sapUiSizeCompact {

	.sapMCb {
		height: 2rem;
		padding-left: 2rem;
		line-height: 2rem;
	}

	.sapMCbBg {
		height: 1rem;
		width: 1rem;
		top: 0.5rem;
		left: 0.5rem;
		border-radius: var(--sapField_BorderCornerRadius);

		&.sapMCbMarkChecked::before {
			font-size: 0.75rem;
		}

		&.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
			border-width: 0.1875rem;
		}
	}

	.sapMCbErr .sapMCbBg.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before,
	.sapMCbWarn .sapMCbBg.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
		border-width: 0.125rem;
	}

	.sapMCbInfo .sapMCbBg.sapMCbMarkChecked.sapMCbMarkPartiallyChecked::before {
		border-width: 0.1875rem;
	}

	.sapMCbDisplayOnly .sapMCbBg:not(.sapMCbMarkPartiallyChecked) {
		margin: 0;
	}

	.sapMCbDisplayOnly .sapMCbBg.sapMCbMark.sapMCbMarkChecked.sapMCbMarkPartiallyChecked {
		top: 0.5625rem;
		left: 0.5625rem;
	}

	/* In Form Checkbox needs to be left aligned to bi in line with other controls (as Form itself has a padding) */
	.sapUiForm {

		.sapMCbBg {
			left: 0;
		}

		.sapMCb {
			padding-left: 1.5rem; /* to have right gap between checkbox and label */
		}

		.sapMCb:not(.sapMCbBgDis).sapMCbHasLabel:focus::before {
			left: -0.1875rem;
		}
	}
}
/* END "CheckBox.less" */

/* START "ColorPalette.less" */
/* =================================== */
/* CSS for control sap.m/ColorPalette  */
/* Horizon High Contrast Black theme   */
/* =================================== */

.sapMColorPalette .sapMColorPaletteSquare:hover > div,
.sapMColorPalette .sapMColorPaletteSquare.sapMColorPaletteSquareSelected > div,
.sapMColorPalette .sapMColorPaletteSquare,
html:not(.sap-phone) .sapMColorPalette .sapMColorPaletteSquare:hover > div,
html:not(.sap-phone) .sapMColorPalette .sapMColorPaletteSquare.sapMColorPaletteSquareSelected > div,
html:not(.sap-phone) .sapMColorPalette .sapMColorPaletteSquare {
	border-radius: 0.25rem;
}

.sapMColorPalette .sapMColorPaletteSquare div {
	border-radius: 0.125rem;
}

html:not(.sap-phone) .sapMColorPalette .sapMColorPaletteSquare {

	&:focus::before {
		content: '';
		box-sizing: border-box;
		position: absolute;
		left: 0.125rem;
		top: 0.125rem;
		right: 0.125rem;
		bottom: 0.125rem;
		border: 0.125rem solid var(--sapButton_Lite_Background);
		pointer-events: none;
	}

	&:hover,
	&.sapMColorPaletteSquareSelected {
		border: 0;

		> div {
			border: 0.125rem solid var(--sapContent_ForegroundBorderColor);
		}
	}

	&:focus::after {
		content: '';
		position: absolute;
		box-sizing: border-box;
		left: 0.125rem;
		top: 0.125rem;
		right: 0.125rem;
		bottom: 0.125rem;
		border: 0.125rem dotted var(--sapContent_ContrastFocusColor);
		pointer-events: none;
	}
}

.sap-desktop .sapMColorPalette .sapMBtn:focus {

	&::after {
		border-width: 0.125rem;
		border-color: var(--sapContent_FocusColor);
	}
}

html:not(.sap-phone) .sapMColorPalette .sap-desktop .sapContrast,
.sap-desktop.sapContrast {

	.sapMColorPalette .sapMBtn {

		&:focus::after {
			border-color: var(--sapContent_FocusColor);

		}

		&:active,
		> .sapMBtnActive,
		&:hover > .sapMBtnActive,
		&:active > .sapMBtnActive {
			color: var(--sapList_TextColor);
		}
	}
}

.sap-phone .sapMColorPaletteSquare {

	&:active > div {
		box-shadow: inset 0 0 0 0.125rem var(--sapContent_ForegroundBorderColor);
	}
}
/* END "ColorPalette.less" */

/* START "ColumnListItem.less" */
/* ===================================== */
/* CSS for control sap.m/ColumnListItem  */
/* Horizon High Contrast Black theme     */
/* ===================================== */

@_sap_m_table_SelectionControlWidth: 2.75rem;

/* selection border indicator */
/* note: adding border-bottom to the td, increased the size of the table, hence not adding border-bottom */
/* note: adding border-top to the sibling row is not suitable as the sibling row can be hidden and in such case the selection border is lost */
.sapMTableTBody:not(.sapMListTblHasPopin) > .sapMLIBSelected,
.sapMTableTBody.sapMListTblHasPopin > .sapMLIBSelected + .sapMListTblSubRow {
	box-shadow: inset 0px -0.0625rem var(--sapList_SelectionBorderColor);
}

/* selection border indicator was not visible on the last row as the td elements within the last row have a bottom border */
/* hence applying -0.125rem so that the selection border is visible */
.sapMTableTBody:not(.sapMListTblHasPopin) > .sapMLIBSelected:last-child,
.sapMTableTBody.sapMListTblHasPopin > .sapMLIBSelected + .sapMListTblSubRow:last-child {
	box-shadow: inset 0px -0.125rem var(--sapList_SelectionBorderColor);
}

/* Safari work-around as box-shadow is not supported on the <tr> element, */
/* hence adding the selection indicator box-shadow to the <td> element */
html[data-sap-ui-browser^="sf"] .sapMTableTBody:not(.sapMListTblHasPopin) > .sapMLIBSelected > td,
html[data-sap-ui-browser^="sf"] .sapMTableTBody.sapMListTblHasPopin > .sapMLIBSelected + .sapMListTblSubRow > td {
	box-shadow: inset 0px -0.0625rem var(--sapList_SelectionBorderColor);
}
/* END "ColumnListItem.less" */

