		border-right: 1px solid var(--sapGroup_TitleBorderColor);
		margin: 0.625rem 0.125rem 0 0.125rem;
	}
}

.sapMITBAll {

	.sapMITBTab {
		margin-top: 0.4rem;
	}

	&.sapMITBHorizontal {

		.sapMITBTab {
			margin-top: 0;
		}

		+ .sapMITBSepLine {
			margin-top: 0.5rem;
		}
	}
