/* Custom focus outline */
html.sap-desktop {

	.sapMITBTextOnly .sapMITBItem:not(.sapUiDnDDragging):focus .sapMITBText {

		&::after {
			top: -0.1875rem;
			bottom: -0.1875rem;
			right: -0.1875rem;
			left: -0.1875rem;
		}
	}

