.sapMITBHorizontal.sapMITBFilterNegative .sapMITBText::before,
.sapMITBTextOnly .sapMITBFilterNegative .sapMITBText::before,
.sapMITBVertical.sapMITBFilterNegative .sapMITBTab::after,
