/* START "SearchField.less" */
/* ================================== */
/* CSS for control sap.m/SearchField  */
/* Horizon High Contrast Black theme  */
/* ================================== */

// ==========================================================================
// Variables overriding
// ==========================================================================

@_sap_m_SearchField_Height: 2.75rem;
@_sap_m_SearchField_ButtonSize: 2.25rem;
@_sap_m_SearchField_ButtonFontSize: 1rem;
@_sap_m_SearchField_Compact_FormPaddingLeft: 0.5rem;
@_sap_m_SearchField_ResetIcon: '\e03e';
@_sap_m_SearchField_PlaceholderFontStyle: normal;
@_sap_m_SearchField_ActiveBackgroundStyle: var(--sapField_BackgroundStyle);

.sapMSFF {
	border-radius: var(--sapField_BorderCornerRadius);
}

.sapMSFDisabled {
	opacity: var(--sapContent_DisabledOpacity);
}

.sapMSFB {
	border-radius: var(--sapField_BorderCornerRadius);
	color: var(--sapButton_TextColor);
	line-height: @_sap_m_SearchField_ButtonSize - @sapUiFieldBorderWidth * 2; /* center the icon vertically */

	&:first-of-type {
		margin-left: 0.25rem;
	}

	&:focus {
		outline: none;
	}

	&:hover {
		box-shadow: var(--sapField_Hover_Shadow);
		background-color: var(--sapButton_Hover_Background);
		border-left: 2px solid var(--sapButton_Hover_BorderColor); /* contrast themes specific */
		border-right: 2px solid transparent;
	}

	&.sapMSFR:not(:last-child):hover { /* if there is no search button the right border is not needed */
		border-right: 2px solid var(--sapButton_Hover_BorderColor); /* contrast themes specific */
	}

	&:active,
	&.sapMSFBA { /* Firefox specific */
		box-shadow: var(--sapField_Hover_Shadow);
		color: var(--sapButton_Selected_TextColor);
		background-color: var(--sapButton_Hover_Background);
	}
}

.sapMSF:not(.sapMSFDisabled):hover .sapMSFF {
	background-color: var(--sapField_Hover_Background);
}

.sapMSF.sapMFocus {

	.sapMSFF {
		background-color: var(--sapField_Focus_Background);
	}

	&:hover .sapMSFF {
		box-shadow: none;
	}
}
/* END "SearchField.less" */

/* START "SegmentedButton.less" */
/* ====================================== */
/* CSS for control sap.m/SegmentedButton  */
/* Horizon High Contrast Black theme      */
/* ====================================== */

.sapMSegB {
	height: 2.75rem;
	vertical-align: top;
	position: relative;

	.sapMSegBBtn {

		.sapMSegBBtnInner {
			font-size: @sapMFontMediumSize;
			height: 2.25rem;
			line-height: 2.25rem;
			padding-left: 0.5625rem;
			padding-right: 0.5625rem;
			text-align: center;
			text-shadow: none;
			color: var(--sapButton_TextColor);
			border-top: 1px solid var(--sapButton_BorderColor);
			border-left: 1px solid var(--sapButton_BorderColor);
			border-bottom: 1px solid var(--sapButton_BorderColor);
			border-right: 1px solid transparent;
			background-color: var(--sapButton_Background);
		}

		&:not(.sapMSegBBtnMixed) .sapMImg {
			padding-left: 0.5625rem;
			padding-right: 0.5625rem;
		}
	}
}

.sapMSegBBtn:first-child .sapMSegBBtnInner {
	border-top-left-radius: 0.375rem;
	border-bottom-left-radius: 0.375rem;
}

.sapMSegBBtn:last-child .sapMSegBBtnInner {
	border-top-right-radius: 0.375rem;
	border-bottom-right-radius: 0.375rem;
}

html.sap-desktop .sapMSegBBtnFocusable:hover .sapMSegBBtnInner {
	background: var(--sapButton_Hover_Background);
}

/* Custom focus outline: */
html.sap-desktop {

	.sapMSegBBtnFocusable:focus .sapMSegBBtnInner {
		outline: 1px dotted;
		outline-offset: -3px;
		outline-color: var(--sapContent_FocusColor);
	}

	.sapMSegBBtnFocusable.sapMSegBBtnSel:focus .sapMSegBBtnInner {
		outline: 1px dotted;
		outline-offset: -3px;
		outline-color: var(--sapContent_ContrastFocusColor);
	}
}

.sapMSegB.sapMSegBIcons {

	.sapMSegBBtn:not(.sapMSegBBtnMixed) .sapMSegBBtnInner {
		padding: 0;
	}

	.sapMSegBBtn.sapMSegBBtnMixed .sapMImg {
		height: 2.125rem;
		width: auto;
		padding-right: 0.375rem;
	}

	.sapMSegBBtn.sapMSegBBtnMixed .sapUiIcon {
		padding-left: 0;
		padding-right: 0.375rem;
		width: 1rem;
	}
}

.sapMSegBBtn.sapMSegBBtnFocusable:active:hover {

	.sapMSegBBtnInner {
		background: var(--sapButton_Active_Background);
		color: var(--sapButton_Selected_TextColor);
		border-color: var(--sapButton_Selected_BorderColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

.sapMSegBBtn.sapMSegBBtnSel {

	.sapMSegBBtnInner {
		background: var(--sapButton_Selected_Background);
		color: var(--sapButton_Selected_TextColor);
		border-color: var(--sapButton_Selected_BorderColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

.sapMSegBBtn.sapMSegBBtnSel:hover {

	.sapMSegBBtnInner {
		border-color: var(--sapButton_Selected_Hover_BorderColor);
	}
}

.sapMSegBBtnFocusable.sapMBtnActive {

	.sapMSegBBtnInner {
		background: var(--sapButton_Selected_Background);
		color: var(--sapButton_Selected_TextColor);
	}

	.sapUiIcon {
		color: var(--sapButton_Selected_TextColor);
	}
}

html.sap-desktop .sapMSegBBtn.sapMSegBBtnFocusable.sapMSegBBtnSel:hover .sapMSegBBtnInner,
html.sap-desktop .sapMSegBBtnFocusable.sapMBtnActive:hover .sapMSegBBtnInner {
	background: var(--sapButton_Selected_Hover_Background);
}

.sapMSegBBtn.sapMSegBBtnFocusable.sapMSegBBtnSel {

	.sapMSegBBtnInner {
		border-right: 1px solid var(--sapButton_Selected_BorderColor);
	}

	.sapMSegBBtnInner:hover {
		border-right: 1px solid var(--sapButton_Selected_Hover_BorderColor);
	}

	/* Hide next button left border */
	+ .sapMSegBBtn .sapMSegBBtnInner {
		border-left: 1px solid transparent;
	}
}

.sapMSegB img {
	height: 2.125rem;
	width: auto;
	max-height: 2.125rem;
	vertical-align: top;
}

.sapMSegBBtn .sapUiIcon {
	width: auto;
	font-size: 1rem;
	line-height: 2.125rem;
	margin-right: 0;
	color: var(--sapButton_IconColor);
	vertical-align: top;
	text-align: center;
}

.sapMSegBBtn.sapMSegBBtnMixed .sapUiIcon {
	padding-right: 0.375rem;
}

.sapMSegBBtn .sapMBtnIcon::before {
	width: 1rem;
	text-align: center;
	display: inline-block;
}

.sapMSB .sapMSBInner .sapMSBText:not(.sapMSBTextIE) .sapMBtnInner {
	margin-right: 2.2rem;
}

.sapMSegBIcons:not(.sapMSegBBtnMixed) {

	.sapMImg,
	.sapUiIcon {
		padding-left: 0.5625rem;
		padding-right: 0.5625rem;
	}
}

/* Compact size */
.sapUiSizeCompact {

	.sapMSegBBtn .sapMSegBBtnInner {
		height: 1.625rem;
		line-height: 1.5rem;
		padding-left: 0.4375rem;
		padding-right: 0.4375rem;
	}

	.sapMSegBBtn:first-child .sapMSegBBtnInner {
		border-top-left-radius: 0.375rem;
		border-bottom-left-radius: 0.375rem;
	}

	.sapMSegBBtn:last-child .sapMSegBBtnInner {
		border-top-right-radius: 0.375rem;
		border-bottom-right-radius: 0.375rem;
	}

	.sapMSegB img {
		line-height: 1.5rem;
		height: 1.5rem;
		width: auto;
	}

	.sapMSegBBtn .sapUiIcon {
		font-size: 1rem;
		line-height: 1.5rem;
		width: 1.0rem;
		vertical-align: top;
	}

	.sapMSegB {

		.sapMBtnIconLeft {
			margin-left: 0;
		}
	}

	.sapMSegBIcons:not(.sapMSegBBtnMixed) {

		.sapMImg,
		.sapUiIcon {
			padding-left: 0.4375rem;
			padding-right: 0.4375rem;
		}
	}

	.sapMSegBIcons {

		.sapMSegBBtn.sapMSegBBtnMixed {

			.sapUiIcon,
			.sapMImg {
				padding-left: 0;
				padding-right: 0.375rem;
				margin: 0;
			}

			.sapMImg {
				height: 1.5rem;
				width: auto; /* 1.5rem; */
			}
		}
	}
}

.sapMSegBBtn.sapMSegBtnLastVisibleButton .sapMSegBBtnInner {
	border-right: 1px solid var(--sapButton_BorderColor);
	border-top-right-radius: 0.375rem;
	border-bottom-right-radius: 0.375rem;
}
/* END "SegmentedButton.less" */

/* START "Select.less" */
/* ================================== */
/* CSS for control sap.m/Select       */
/* Horizon High Contrast Black theme  */
/* ================================== */

/* ------------------------------ */
/* field                          */
/* ------------------------------ */

.sapMSlt.sapMSltIconOnly {
	border-radius: 0.365rem;
}

.sapMSlt {
	height: @sapUiElementHeight;
}

.sapUiSizeCompact .sapMSlt {
	height: @sapUiElementCompactHeight;
}

/* arrow styles*/

.sapMSlt > .sapMSltArrow {
	line-height: 2.125rem;
}

.sapMSltArrow {
    width: 2.25rem;
    height: 2.25rem;
}

.sapUiSizeCompact .sapMSltArrow {
    width: 2rem;
    height: 1.625rem;
}

/* hover and focus */

.sapMSlt.sapMSltIconOnly.sapMSltHoverable:hover:not(.sapMSltState) {
	border-width: 0.125rem;
}

.sapMSlt.sapMSltDefault.sapMSltFocused:not(.sapMSltIconOnly):not(.sapMSltPressed) {
	outline: @sapUiContentFocusWidth @sapUiContentFocusStyle @sapUiContentContrastFocusColor;
	outline-offset:  calc(-2.5 * @sapUiContentFocusWidth);
}

html.sap-desktop .sapMSlt.sapMSltFocused:not(.sapMSltIconOnly):not(.sapMSltDisabled):not(.sapMSltInformation),
.sapMSltHoverable:not(.sapMSltIconOnly):not(.sapMSltInformation):hover {
	border-color: @sapUiFieldHoverBorderColor;
}

/* FIX: In FF bottom outline-offset is not working as expected when Select is in sap.m.Bar and is left-aligned */

html[data-sap-ui-browser^="ff"] .sapMBar .sapMSlt.sapMSltFocused {
	line-height: 0;
}

/* icon only hover and focus */

.sapMSlt.sapMSltIconOnly.sapMSltHoverable:hover {
	background: @sapUiButtonLiteHoverBackground;

	&.sapMSltFocused:not(.sapMSltPressed) {
		border-color: transparent;
	}
}

/* pressed and hover */
.sapMSltIconOnly.sapMSltPressed.sapMSltHoverable:hover {
	background: @sapUiToggleButtonPressedHoverBackground;
}

.sapMSlt:not(.sapMSltInformation):not(.sapMSltReadonly):not(.sapMSltDisabled) {
	border-width: 0.125rem;
}

/* value state */

.sapMSltWarning,
.sapMSltError,
.sapMSltInformation {
	border-style: dashed;
}

.sapMSlt.sapMSltWarning > .sapMSltLabel,
.sapMSlt.sapMSltError > .sapMSltLabel {
	font-style: italic;
	font-weight: bold;
}

.sapMSltInformation {
	border-color: @sapUiFieldWarningColor;
}

.sapMSltLabelState, .sapMSltArrowState {
    line-height: initial;
}

.sapUiSizeCompact .sapMSltLabelState,
.sapUiSizeCompact .sapMSltArrowState {
	line-height: initial;
}

/* disabled */

.sapMSltDisabled {
	opacity: 0.5;
}

/* ------------------------------ */
/* picker                         */
/* ------------------------------ */
@_sap_m_SltPicker_SubHeader_BoxShadow_Bottom: 0.125rem;
div.sapMSltPicker {
	border-radius: 0.125rem;

	.sapMBar {
		box-shadow: inset 0 -@_sap_m_SltPicker_SubHeader_BoxShadow_Bottom @sapUiPageHeaderBorderColor;
	}

	.sapMSltPickerValueState {
		padding-left: 1.5rem;
		box-shadow:inset 0 -0.125rem @sapUiPageHeaderBorderColor;
		line-height: 1rem;
		padding-right: 0.5rem;
		padding-left: 2rem;

		&::before {
			font-family: "SAP-icons";
			vertical-align: middle;
			font-size: 1rem;
			position: absolute;
			left: 0.5rem;
			top: 0.625rem;
		}

		&.sapMSltPickerErrorState::before {
			content: '\e0b1';
		}

		&.sapMSltPickerWarningState::before {
			content: '\e201';
		}

		&.sapMSltPickerSuccessState::before {
			content: '\e203';
		}

		&.sapMSltPickerInformationState::before {
			content: '\e202';
		}
	}
}

.sapMSlt > .sapMSltArrow {
	border-left: 0.0625rem solid @sapUiListSelectionBorderColor;
}

/* pressed */

.sapMSltPressed > .sapMSltArrow:hover {
	background: @sapUiButtonLiteHoverBackground;
}

/* ====================================================== */
/* Select inside a Bar: all contexts                      */
/* ====================================================== */

/* focus: Select IconOnly in all contexts get dotted outline */

html.sap-desktop .sapMSltIconOnly.sapMSltFocused:not(.sapMSltExpanded) {
	outline: 0.125rem dotted @sapUiContentFocusColor;
	outline-offset: -0.125rem;
	border-color: transparent;
}

/* hover: Select IconOnly in all contexts */

html.sap-desktop .sapMHeader-CTX .sapMSltIconOnly:hover:not(.sapMSltPressed):not(.sapMTSSlt),
html.sap-desktop .sapMSubHeader-CTX .sapMSltIconOnly:hover:not(.sapMSltPressed):not(.sapMTSSlt),
html.sap-desktop .sapMFooter-CTX .sapMSltIconOnly:hover:not(.sapMSltPressed):not(.sapMTSSlt),
html.sap-desktop .sapMSltIconOnly:hover:not(.sapMSltPressed):not(.sapMTSSlt) {
	color: @sapUiContentIconColor;
	background-color: @sapUiButtonLiteHoverBackground;
}

.sapMSltHoverable:not(.sapMSltError):not(.sapMSltPressed):hover > .sapMSltArrow,
.sapMSltPressed.sapMSltError > .sapMSltArrow {
	background-color: @sapUiButtonLiteHoverBackground;
}

.sapMSltPressed:not(.sapMSltError) > .sapMSltArrow {
	background: @sapUiListSelectionBackgroundColor;
}
/* END "Select.less" */

/* START "SelectDialog.less" */
