/* START "Switch.less" */
/* ================================== */
/* CSS for control sap.m/Switch       */
/* Horizon High Contrast Black theme  */
/* ================================== */

/* ------------------------------ */
/* Switch container               */
/* ------------------------------ */

.sapMSwtCont {
	overflow: hidden;
	//in order to have a touchable area of 2.75rem height and 3.5rem width
	padding: 0.625rem 0.5rem;
}

/* focus */

html.sap-desktop {
	.sapMSwtCont:focus > .sapMSwt:before {
		content: " ";
		position: absolute;
		display: block;
		top: -0.3125rem;
		left: -0.3125rem;
		bottom: -0.3125rem;
		right: -0.3125rem;
		border: 0.125rem solid @sapUiContentFocusColor;
		border-radius: 1rem;
	}
	.sapUiSizeCompact {
		.sapMSwtCont:focus > .sapMSwt:before {
			border-radius: 0.875rem;
		}
	}
}

/* ------------------------------ */
/* Switch                         */
/* ------------------------------ */

.sapMSwt {
	width: 2.875rem;
	height: 1.5rem;
	overflow: visible;
	border: none;
	margin: 0;
	border-radius: 0.75rem;
