	left: -1.25rem;
}

.sapMSwtOn .sapMSwtTextOff {
	display: none;
}

.sapMSwtOff .sapMSwtTextOn {
	display: none;
}

/* ------------------------------ */
/* Compact mode                   */
/* ------------------------------ */

.sapUiSizeCompact {
	.sapMSwtCont {
