				height: 1rem;
				width: 1.75rem;
			}
			.sapMSwtText {
				line-height: 1.25rem;
				&.sapMSwtTextOn {
					left: 2.0625rem;
				}
				&.sapMSwtTextOff {
					left: 2.0625rem;
				}
				.sapMSwtLabel {
					width: 1.75rem;
					line-height: 1.125rem;
				}
			}
			.sapMSwtOn .sapMSwtHandle {
				left: 2.125rem;
			}
			&.sapMSwtNoLabel,
			&.sapMSwtAcceptReject {
				width: 2rem;
				height: 1.25rem;
				.sapMSwtHandle {
					width: 1.25rem;
				}
				&.sapMSwtOn .sapMSwtHandle{
					left: 1.88rem;
				}
				.sapMSwtText {
					&.sapMSwtTextOn {
						left: 1.325rem;
					}
					&.sapMSwtTextOff {
						left: 1.625rem;
					}
				}
				&.sapMSwtOn .sapMSwtHandle {
					left: 1.8125rem;
				}
			}
		}
	}
	.sapMSwtOn.sapMSwtNoLabel .sapMSwtLabelOn::before,
	.sapMSwtOn.sapMSwtAcceptReject .sapMSwtLabelOn::before,
	.sapMSwtOff.sapMSwtNoLabel .sapMSwtLabelOff::before,
	.sapMSwtOff.sapMSwtAcceptReject .sapMSwtLabelOff::before {
		font-size: @sapMFontMediumSize;
		right: 0.3125rem;
	}
	.sapMSwtOff.sapMSwtAcceptReject .sapMSwtLabelOff::before {
		right: 0.4375rem;
	}
}
