.sapUiTab:first-child,
.sapUiTabDsbl:first-child {
	background-image:url(img/tabstrip/tab-left-first.png), url(img/tabstrip/tab-right.png),url(img/tabstrip/tab.png);
	padding-left: 25px;
}

.sapUiTabSel:first-child {
	margin-left: 0;
}

.sapUiTabClose {
	background-image:url(img/tabstrip/tab-close.gif);
	background-repeat:no-repeat;
	background-positon:top right;
	width: 13px;
	height: 13px;
	margin-top: 3px;
	position: relative;
	left: 4px;
}

.sapUiTabSel .sapUiTabClose {
	background-image:url(img/tabstrip/tab-close.gif);
}

.sapUiTabClose:hover {
	background-image:url(img/tabstrip/tab-close-hov.gif);
}

.sapUiTabIco {
	margin-right: 4px;
	margin-top: 2px;
}

.sapUiTabBar .sapUiTabMenu {
	background-image: url(img/tabstrip/tab-menu.png);
	width: 16px;
	height: 16px;
	margin-right: 1px;
}

.sapUiTabPanel {
	top: 24px;
}

.sapUiTabSel:focus,
.sapUiTab:focus,
.sapUiTabDsbl:focus {
  outline: none;
}

.sapUiTabSel,
.sapUiTab,
.sapUiTabDsbl {
  &:focus::before {
	border: 0.1875rem solid @sapUiContentFocusColor;
	position: absolute;
	content: "";
	top: 0;
	right: 0;
	bottom: 0;
	left: 0;
	z-index: 1;
	pointer-events: none;
  }
}

.sapUiTabBar .sapUiTabStripScrollIcon {
	padding-top: 3px;
	margin-top: 0;
	height: 19px;
}

.sapUiTabDsbl:focus::before {
